// Likes.jsx
import React from 'react';

const Likes = ({ likeList }) => {
  return (
      <div className="likes">
          <ul>
              {likeList.map(like => (
                  <li key={like.userId} className="like-item">
                      Liked by: {like.userName} {/* Assuming userName is part of the like object */}
                  </li>
              ))}
          </ul>
      </div>
  );
};

export default Likes;
